measure.description:
ECOG performance status is used to describe a patient’s level of functioning in terms of their ability to care for themselves, daily activity, and physical ability (walking, working, etc.). The scale ranges from 0 to 5:
0 = Fully active, no restrictions;
1 = Restricted activity but ambulatory, able to carry out work of a light nature;
2 = Ambulatory and capable of all self-care but unable to carry out work activities;
3 = Limited self-care, confined to bed or chair more than 50% of waking hours;
4 = Completely disabled, no selfcare, confined to bed or chair;
5 = Dead
